import { LOGIN_REQUEST } from '../actions/auth/auth.types'

const initialState = {}

export const authReducer = (state = initialState, action) => {
  switch (action.type) {
    case LOGIN_REQUEST:
      state = {
        ...state,
        authenticate: false,
        authenticating: true,
        ...action.payload,
      }

    default:
      return state
  }
}
